const MapComponent: React.FC = () => {
  const [selectedCard, setSelectedCard] = useState<CardData>(cardData.default);

  const handleProvinceClick = (provinceId: string) => {
    // Find the corresponding card ID from your provinces array
    const selectedProvince = provinces.find(p => p.id === provinceId);
    if (selectedProvince && cardData[selectedProvince.pId]) {
      setSelectedCard(cardData[selectedProvince.pId]);
    }
  };

  return (
    <div className={styles.forBlanks}>
      <div className="container mt-5">
        <div className={styles.mapView}>
          <div id="map-animation">
            <div id="map-area">
              <svg id="Map" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 462.09 739.7" className={styles.position}>
                {Object.keys(PROVINCE_PATHS).map(provinceId => (
                  <path
                    key={provinceId}
                    id={provinceId}
                    className="cls-2"
                    fill={PROVINCE_COLORS[provinceId]}
                    d={PROVINCE_PATHS[provinceId]}
                    onClick={() => handleProvinceClick(provinceId)}
                  />
                ))}
              </svg>
            </div>
          </div>
          <CardComponent
            title={selectedCard.title}
            content={selectedCard.content}
            imageUrl={selectedCard.imageUrl}
            buttonLink={selectedCard.buttonLink}
          />
        </div>
      </div>
    </div>
  );
};

export default MapComponent;